import React from 'react';

const imageChangeOnMouseOver = () => {
  return (
    <div>
      <ImageToggleOnMouseOver  primaryImage='/static/floro-cristina-5107-before.jpg' 
                    secondaryImage='./images/floro-cristina-5107-final.jpg'
                    alt="before" />
    </div>
  )
}

export default imageChangeOnMouseOver;
